import React from 'react';
import resume from '../../assets/resume.png';
import './cv.css';



const Cv = () => {
    return (
        <section>
            <h1>My Resume</h1>
            <img src={resume} alt="Profile" className="resume"></img>
        </section>
        );
}

export default Cv;
